import React, { Component } from 'react';
import './app.scss';
import { Content } from 'carbon-components-react';
import ActionsHeader from './components/ActionsHeader';

import { Route, Switch } from 'react-router-dom';
import OverviewPage from './content/OverviewPage';
import EngagementPage from './content/EngagementPage';
import AssistantLoader from './AssistantLoader';

assistantLoader.loadAssistants()

class App extends Component {
  render() {
    return (
      <>
        <ActionsHeader/>
        <Content>
          <Switch>
            <Route exact path="/" component={OverviewPage} />
            <Route path="/engagement" component={EngagementPage} />
          </Switch>
        </Content>
      </>
    );
  }
}

export default App;
